INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES ('98', '1', 'Истребитель F-15', 'Сборная деревянная модель "Самолет F-15", артикул: P044. Комплект включает в себя набор деталей, вырезанных на листовом дереве (фанера); схему сборки; наждачную бумагу. Детали скрепляются в порядке и очередности, обозначенной в инструкции. Для прочности соединений рекомендуется использовать клей ПВА (не токсичен, не имеет запаха, после высыхания становится прозрачным, имеет эластичный клеевой шов, при загустевании может быть разбавлен водой). Возрастная ориентация: от 5 до 105 лет.&nbsp; Загрузить схему сборки модели Самолет F-15', '0', '', 'Истребитель F-15 Авиация Размер упаковки: 23 х 18,5 х 0,9 см.  Размер сборки: 17,5х25,5х18,4 см. Количество элементов: 37.  Масса: 0,213 кг. Сделано из дерева', 'Истребитель F-15,P044,Омск, деревянные 3D пазлы, чудо дерево, вга, модели из дерева', '');
